import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return (
    <div>
      {props.expenses.map((item, idx) => (
        <ExpenseItem 
          title={item[idx].title}
          amount={item[idx].amount}
          date={item[idx].date}
        />
      ))}
    </div>
  );
}

export default Expenses;
